description:
Verenigde Staten
Komedie / Romantiek
90 minuten

geregisseerd door Damon Santostefano
met Selena Gomez, Andrew Seeley en Jane Lynch

Mary is een jonge tiener die woont bij haar stiefmoeder Dominique Blatt, een bekende zangeres, en diens dochters Britt en Bree. Op een gemaskerd bal ontmoet ze zanger Joey. Ze dansen en worden onmiddellijk verliefd op elkaar. Ze verlaat het feest echter en laat onderweg haar iPod vallen. Joey raapt deze op, maar heeft geen idee wie ze werkelijk is.

Vanaf 18 november in de videotheek.

